import { BrowserRouter, Routes, Route } from "react-router-dom";
import Topbar from "./components/Layout/Topbar";

function App() {
  return (
    <BrowserRouter>
      <Topbar/>
      <Routes>
        <Route path="/" element></Route>
        <Route path="/floor4"></Route>
        <Route path="/floor15"></Route>
      </Routes>


    </BrowserRouter>
  );
}

export default App;
